import React, { useEffect, useState } from 'react';
import { Routes, Route } from 'react-router-dom';
import Navigation from './components/Navigation';
import Registration from './pages/Registration';
import PlayersList from './pages/PlayersList';
import Fixtures from './pages/Fixtures';
import Schedule from './pages/Schedule';
import LiveScore from './pages/LiveScore';
import Results from './pages/Results';
import api from './services/api';

const App: React.FC = () => {
  const [stats, setStats] = useState({
    totalPlayers: 0,
    totalMatches: 0,
    liveMatches: 0,
    completedMatches: 0,
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchStats = async () => {
      try {
        const [playersRes, matchesRes] = await Promise.all([
          api.get('/players/'),
          api.get('/matches/'),
        ]);

        const players = playersRes.data;
        const matches = matchesRes.data;

        setStats({
          totalPlayers: players.length,
          totalMatches: matches.length,
          liveMatches: matches.filter((m: any) => m.status === 'LIVE').length,
          completedMatches: matches.filter((m: any) => m.status === 'COMPLETED').length,
        });
      } catch (error) {
        console.error('Failed to fetch stats:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchStats();
  }, []);

  const HomePage = () => (
    <div className="p-4 fade-in">
      {/* Hero Section */}
      <div
        className="card mb-4"
        style={{
          background: 'linear-gradient(135deg, var(--accent-secondary) 0%, var(--accent-primary) 100%)',
          color: 'white',
          textAlign: 'center',
        }}
      >
        <div className="card-body" style={{ padding: '3rem 2rem' }}>
          <h1 style={{ fontSize: '3rem', marginBottom: '1rem' }}>
            üèì Badminton Tournament Manager
          </h1>
          <p style={{ fontSize: '1.2rem', marginBottom: '2rem', opacity: 0.9 }}>
            Professional tournament management system for badminton enthusiasts
          </p>
          <div style={{ display: 'flex', gap: '1rem', justifyContent: 'center', flexWrap: 'wrap' }}>
            <a href="/register" className="btn btn-outline" style={{ color: 'white', borderColor: 'white' }}>
              üìù Register Player
            </a>
            <a href="/live" className="btn" style={{ background: 'white', color: 'var(--accent-secondary)' }}>
              üéØ View Live Scores
            </a>
          </div>
        </div>
      </div>

      {/* Stats Dashboard */}
      <div className="mb-4">
        <h2 className="mb-3">üèÜ Tournament Overview</h2>
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))', gap: '1rem' }}>
          <div className="card">
            <div className="card-body text-center">
              <div style={{ fontSize: '3rem', marginBottom: '1rem' }}>üë•</div>
              <h3>{loading ? '...' : stats.totalPlayers}</h3>
              <p className="text-muted mb-0">Total Players</p>
            </div>
          </div>

          <div className="card">
            <div className="card-body text-center">
              <div style={{ fontSize: '3rem', marginBottom: '1rem' }}>üèì</div>
              <h3>{loading ? '...' : stats.totalMatches}</h3>
              <p className="text-muted mb-0">Total Matches</p>
            </div>
          </div>

          <div className="card">
            <div className="card-body text-center">
              <div style={{ fontSize: '3rem', marginBottom: '1rem' }}>
                <span className="live-indicator"></span>
              </div>
              <h3 className="shuttlecock">{loading ? '...' : stats.liveMatches}</h3>
              <p className="text-muted mb-0">Live Matches</p>
            </div>
          </div>

          <div className="card">
            <div className="card-body text-center">
              <div style={{ fontSize: '3rem', marginBottom: '1rem' }}>üèÖ</div>
              <h3 className="court">{loading ? '...' : stats.completedMatches}</h3>
              <p className="text-muted mb-0">Completed Matches</p>
            </div>
          </div>
        </div>
      </div>

      {/* Quick Actions */}
      <div className="card">
        <div className="card-header">
          <h3 className="mb-0">‚ö° Quick Actions</h3>
        </div>
        <div className="card-body">
          <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', gap: '1rem' }}>
            <a href="/fixtures" className="btn btn-secondary">
              üèÜ Generate Fixtures
            </a>
            <a href="/schedule" className="btn btn-secondary">
              üìÖ Manage Schedule
            </a>
            <a href="/players" className="btn btn-secondary">
              üë• View Players
            </a>
            <a href="/results" className="btn btn-secondary">
              üèÖ View Results
            </a>
          </div>
        </div>
      </div>
    </div>
  );

  return (
    <div className="app">
      <Navigation />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/register" element={<Registration />} />
        <Route path="/players" element={<PlayersList />} />
        <Route path="/fixtures" element={<Fixtures />} />
        <Route path="/schedule" element={<Schedule />} />
        <Route path="/live" element={<LiveScore />} />
        <Route path="/results" element={<Results />} />
      </Routes>
    </div>
  );
};

export default App;
